import themeReducer from './themeReducer';
import rtlReducer from './rtlReducer';
import sidebarReducer from './sidebarReducer';
import cryptoTableReducer from './cryptoTableReducer';
import newOrderTableReducer from './newOrderTableReducer';
import customizerReducer from './customizerReducer';
import todoReducer from './todoReducer';
import authReducer from './authReducer';
import newCommoditiesTableReducer from './newCommoditiesTableReducer';
import newOilTableReducer from './newOilTableReducer';
import newGasTableReducer from './newGasTableReducer';
import newNewOrderTableReducer from './newNewOrderTableReducer';
export {
  themeReducer,
  rtlReducer,
  sidebarReducer,
  cryptoTableReducer,
  newOrderTableReducer,
  newCommoditiesTableReducer,
  customizerReducer,
  todoReducer,
  authReducer,
  newOilTableReducer,
  newGasTableReducer,
  newNewOrderTableReducer,
};
